            semester: "значение поля course/semester"},
            {id: "3",
            name: "Информатика",
            semester: "значение поля course/semester"}

        ]
    }

    static async getGroups(idCourse){
        //const response = await axios.get(`cousres/${idCourse}/groups`, {});
        if(idCourse===1){
            return ["4031", "4032", "4036", "Z0431"]
